import React from 'react'
import Fetch from './Fetch';
import FetchCity from './FetchCity';

function Zone3( {id, isFetching} ) {
  if(id.length == 0){
    return(
      <Fetch isFetching={isFetching}/>
    )
  }else{
    return(
      <FetchCity id={id} />
    )
  }
}

export default Zone3
